let canvas = window.c;

console.log(window.c)

let PTM = 20;
let sprites = [];
let world, renderer, particleSystem;

let gravity = new Box2D.b2Vec2(0, -10);

function getRandom(min, max) {
    return Math.random() * (max - min) + min;
}

function createBox(x, y, w, h, fixed) {
    let bd = new Box2D.b2BodyDef();
    if (!fixed) {
        bd.set_type(2);
    }
    bd.set_position(new Box2D.b2Vec2(x, y));

    let body = world.CreateBody(bd);

    let shape = new Box2D.b2PolygonShape;
    shape.SetAsBox(w/2, h/2);
    body.CreateFixture(shape, 1.0);

    let sprite = PIXI.Sprite.from(PIXI.Texture.WHITE);

    sprite.width = w * PTM;
    sprite.height = h * PTM;
    sprite.anchor.set(0.5);
    sprite.body = body;
    renderer.stage.addChild(sprite);
    sprites.push(sprite);
    return body;
}

function distanceSquared(x,y,x2,y2) {
  return (x2-x)*(x2-x) + (y2-y)*(y2-y)
}

function createParticleSystem() {
    let psd = new Box2D.b2ParticleSystemDef();
    psd.set_radius(0.2);
    particleSystem = world.CreateParticleSystem(psd);
    particleSystem.SetMaxParticleCount(8000);

    let dummy = PIXI.Sprite.from(PIXI.Texture.EMPTY);
    renderer.stage.addChild(dummy);

    particleSystemSprite = new LiquidfunSprite(particleSystem);
    renderer.stage.addChild(particleSystemSprite);
}

function spawnParticles(radius, x, y, xvel, yvel) {
    let color = new Box2D.b2ParticleColor(0, 255, 0, 255);
    // flags
    let flags = (0<<0);

    let pgd = new Box2D.b2ParticleGroupDef();
    let shape = new Box2D.b2CircleShape();
    shape.set_m_radius(radius);
    pgd.set_shape(shape);
    pgd.set_color(color);
    pgd.set_flags(flags);
    pgd.set_lifetime(getRandom(3,15));
    pgd.set_linearVelocity(new Box2D.b2Vec2(xvel, yvel))
    shape.set_m_p(new Box2D.b2Vec2(x, y));
    group = particleSystem.CreateParticleGroup(pgd);
    return group;
}

function spawnRain() {
    let x = getRandom(-25, 25);
    let group = spawnParticles(0.09, x, 25);
    //group.ApplyLinearImpulse(wind);
}

function init() {
    // stats
    // let stats = new Stats();
    // document.body.appendChild(stats.domElement);

    // renderer
    let w = window.innerWidth;
    let h = window.innerHeight;
    console.log("w,h", w,h)
    renderer = new PIXI.Application(w, h, {backgroundColor : 0xffffff});

    let W = w/PTM
    let H = h/PTM

    document.body.appendChild(renderer.view);
    //let killerShape = new Box2D.b2PolygonShape;
    //killerShape.SetAsBox(w, h);
    //let killerTransform = new Box2D.b2Transform;
    //killerTransform.Set(new Box2D.b2Vec2(0, 0), 0);

    // shift 0/0 to the center
    renderer.stage.position.x = w/2;
    renderer.stage.position.y = h/2;

    // world
    world = new Box2D.b2World(gravity);

    // walls
    createBox(0,    -H/2, W, 1,   true);
    createBox(-W/2, 0,    1, 3*H, true);
    createBox(W/2,  0,    1, 3*H, true);


    createParticleSystem();


    let faceRadius = 5

    let nauseatedFace = PIXI.Sprite.from('/assets/nauseated-face.png');
    let vomitingFace = PIXI.Sprite.from('/assets/vomiting-face.png');

    [nauseatedFace, vomitingFace].forEach((face)=> {
      face.width = 2*faceRadius*PTM;
      face.height = 2*faceRadius*PTM;
      face.anchor.set(0.5);
      face.position.set(0, 0)
      renderer.stage.addChild(face);
    })
    vomitingFace.x -= faceRadius*PTM*0.05
    vomitingFace.y += faceRadius*PTM*0.15

    vomitingFace.width  = 2.16*faceRadius*PTM;
    vomitingFace.height = 2.16*faceRadius*PTM;
   // vomitingFace.width = nauseatedFace.width*

    nauseatedFace.visible = true
    vomitingFace.visible = false

    source = {x:0, y:-1.5}

    renderer.ticker.add(function() {
        for (let i=0,s=sprites[i];i<sprites.length;s=sprites[++i]) {
            let pos = s.body.GetPosition();
            s.position.set(pos.get_x()*PTM, -pos.get_y()*PTM)
            s.rotation = -s.body.GetAngle();
        }
        // stats.update();
    });

    window.timestep = 0
    let spewPeriod = 4
    // update loop
    function update() {
        //particleSystem.DestroyParticlesInShape(killerShape, killerTransform);
        world.Step(1/60, 5, 3);
        if (window.sick && window.timestep%spewPeriod == 0) {
          spawnParticles(2, source.x, source.y, 0, -20);
        }
        window.timestep++
    }
    window.setInterval(update, 1000 / 60);
    //window.setInterval(spawnRain, 10);

    renderer.view.addEventListener("mousedown", function(e) {

        let x = ((e.clientX - renderer.view.offsetLeft) - w/2) / PTM;
        let y = (-(e.clientY - renderer.view.offsetTop) + h/2) / PTM;

        if (distanceSquared(x, y, source.x, source.y) < faceRadius*faceRadius) {
          window.sick = true
          nauseatedFace.visible = false
          vomitingFace.visible = true
        }
    });

    renderer.view.addEventListener("mouseup", function(e) {
        let x = ((e.clientX - renderer.view.offsetLeft) - w/2) / PTM;
        let y = (-(e.clientY - renderer.view.offsetTop) + h/2) / PTM;

        window.sick = false
        nauseatedFace.visible = true
        vomitingFace.visible = false
        
    });
};

setTimeout(init, 0)
